function readMorse(e){var t=new(window.AudioContext||window.webkitAudioContext),a=t.createGain();a.gain.value=0;var n=t.createOscillator();n.frequency.value=600,n.connect(a),a.connect(t.destination),n.start(0);var i,r=t.currentTime,c=r;for(i=0;i<e.length;i++)switch(e.charAt(i)){case".":a.gain.setValueAtTime(1,c),c+=.07,a.gain.setValueAtTime(0,c),c+=.07;break;case"-":a.gain.setValueAtTime(1,c),c+=3*.07,a.gain.setValueAtTime(0,c),c+=.07;break;case" ":a.gain.setValueAtTime(0,c),c+=3*.07}n.stop(c-r)}function htmlEntities(e){var t=String(e).replace(/&/g,"&amp;").replace(/</g,"&lt;");return t=t.replace(/>/g,"&gt;").replace(/"/g,"&quot;").replace(/ /gi,"&nbsp;")}